import { Link } from "react-router-dom";
import { users } from "../db";

function Home() {
  return (
    <div>
      <h1>Users</h1>
      <ul>
        {users.map((user) => (
          <li key={user.id}>
            <Link to={`/users/ ${user.id}`}></Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Home;
